// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Conditional {
    function check(uint256 a, uint256 b) public pure returns (uint256) {
        uint256 c;

        require(a > b, "a should be grater than b");
        c = a;

        return c;
    }
}
